import React from "react";

const DashBoard = () => {

  const handleUrlSubmit = async(e) => {
    e.preventDefault();
    console.log("Submit")
  }

  return (
    <div>
      <div>
        <form onSubmit={handleUrlSubmit}>
          <input type="text" placeholder="Enter Url here " />
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default DashBoard;
